    t_return_end = pulses[1]+t_flight #Time that returned pulse ends in us#

    if t_return_start <= detects[0] and t_return_end >= detects[1] : #Duration of interaction between returned pulse and detection window in us#
        t_interact = t_detect
    elif t_return_start > detects[0] and t_return_end < detects[1] :
        t_interact = t_return_end-t_return_start
    elif t_return_start > detects[0] and t_return_end >= detects[1] and detects[1] > t_return_start :
        t_interact = detects[1]-t_return_start
    elif t_return_start <= detects[0] and t_return_end < detects[1] and detects[0] < t_return_end :
        t_interact = t_return_end-detects[0]
    else :
        t_interact = 0

    detuning = 2*target[example][2]*freq/c #Doppler shift of returned pulse [Mrad/s]#

    phase_shift = (detuning*0.5*t_flight)+np.pi #Phase shift of the returned pulse [rad]#
    phase = phase_shift-(detects[2])
    
    P_c = sigma_R*P_e*target[example][1]/((4*np.pi*((target[example][0])**2))**2) #Received power [W]#
    rabi = eta*np.sqrt(P_c) #Rabi frequency [Mrad/s]#

    Rabi = np.sqrt((rabi**2)+(detuning**2)) #Rabi oscillation frequency [Mrad/s]#

    #Sensor signal#
    signal_mean = 0.5+(0.5*np.exp(-t_detect/T2)*rabi*np.cos(phase)*np.sin(Rabi*t_interact)/Rabi) #Signal mean#
    signal_std = np.sqrt(signal_mean*(1-signal_mean)/N) #Signal standard deviation#
    signal = np.random.normal(signal_mean,signal_std) #Randomly samples sensor output#

    #Outputs#
    return signal

