#Test for valid config during development#
def dev_config(config) :
    #Inputs#
    #config = [[pulses, detects, example]...]# where pulses = [[tstart,tend],...], detects = [[tstart,tend, phase],...] and example = 0--999

    #Test if config data structure is valid
    error_1 = 0
    error_2 = 0
    error_3 = 0

    con = 1
    
    while con < len(config) :
        if config[con][2] <= config[con-1][2] :
            error_2 = 1 #Targets ordered incorrectly or duplicated
        con += 1

    if config[0][2] != 0 :
        error_3 = 1 #Targets not numbered correctly - not index from 0

    #Run test of the pulses and detects for each target

    error_4 = 0

    for i in config :
        error_4 += test_pulses(i[0])+test_detects(i[1])

    #Print errors#
    #if error_1 == 0 and error_2 == 0 and error_3 == 0 :
    #    print('Valid detection windows: no errors')
    #if error_1 == 1 :
    #    print('Error: incorrect number of targets')
    #if error_2 == 1 :
    #    print('Error: targets ordered incorrectly')
    #if error_3 == 1 :
    #    print('Error: targets are numbered incorrectly (are not indexed from 0)')
    #if error_4 == 1 :
    #    print('Error: pulses or detects invalid')

    #Output
    return error_1+error_2+error_3+error_4 #if this is = 1 then an error has occured

